(1, 4, 'simple', NULL, NULL, NULL, '2017-11-26 05:34:18', '<p>Every woman knows that her most sophisticated and impressive outfit is not complete without perfect lingerie underneath. Just as an old joke says, “She was wearing all white, but no one could see that, as there was a black dress on her”.</p>  \r\n<p>Lingerie is more than just a garment. For some reason, it is often considered to be a topic which is not appropriate to be talked about. However, it deserves just as much attention as usual clothing. It may be fashionable or not, it may be comfortable or not,  it may suit you or not. This is why it should be talked about, paid attention to and enjoyed.</p>\r\n<p>What is offered in this online store? Most comfortable sleepwear, extremely elegant swimwear, seductive lingerie, regular and plus size shapewear and so on. An extensive range of lingerie includes naughty and nice models. Be sure that whichever evening you are planning, in the lingerie which fits your body perfectly, which is comfortable and at the same time makes you look gorgeous, it will be amazing. Either it’s a special moment with your loved one, or a gathering with your friends at a tennis court, the lingerie which you’ll be wearing will make you as comfortable as possible.</p> ', 2, 0, '/a/s/asos_bridal_here_comes_the_bride_vest_short_pyjama_set.jpg', NULL, NULL, NULL, NULL, NULL, NULL, 'ASOS BRIDAL Here Comes The Bride Vest & Short Pyjama Set', NULL, NULL, NULL, '36.0000', NULL, NULL, 0, 'We advocate comfortable, elegant and beautiful lingerie.', '9658', NULL, '/a/s/asos_bridal_here_comes_the_bride_vest_short_pyjama_set.jpg', NULL, '2017-12-26 00:00:00', '30.0000', '2025-12-26 00:00:00', '/a/s/asos_bridal_here_comes_the_bride_vest_short_pyjama_set_1.jpg', 2, '/a/s/asos_bridal_here_comes_the_bride_vest_short_pyjama_set.jpg', NULL, NULL, NULL, NULL, '2017-12-26 10:40:17', 'asos-bridal-here-comes-the-bride-vest-short-pyjama-set', NULL, 4, '1.0000', NULL),
