(1, '404 Não encontrado', '1column', 'Page keywords', 'Page description', 'no-route', 'Whoops, our bad...', '<div class=\"not-found-page\">\r\n    <dl>\r\n        <dt class=\"not-found-page_top\">\r\n            <img src=\"{{view url=\'images/404.png\'}}\" alt=\"404-img\">\r\n            <div>\r\n                <strong>Desculpe...</strong>\r\n                <span>Não é você. Somos nós.</span>\r\n            </div>\r\n        </dt>\r\n    </dl>\r\n    <dl class=\"not-found-page_bottom\">\r\n        <dt>A página que você está procurando não pode ser encontrada.</dt>\r\n        <dd><a href=\"{{store url=\"\"}}\">Página Inicial!</a></dd>\r\n    </dl>\r\n</div>', '2017-10-21 02:06:12', '2020-10-01 13:44:28', 1, 0, '', '', '', NULL, NULL, NULL, ''),
(2, 'Magetique', '1column', '', '', 'home', '', '\r\n', '2017-10-21 02:06:12', '2017-10-21 02:06:12', 1, 0, '<!--\r\n    <referenceContainer name=\"right\">\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.viewed</argument></action>\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.compared</argument></action>\r\n    </referenceContainer>-->', '', '', NULL, NULL, NULL, ''),
(4, 'Política de Privacidade', '1column', '', '', 'privacy-policy-cookie-restriction-mode', '', '<div class=\"change-message\">\r\n    <span>Substitua este texto pela sua Política de Privacidade.</span>\r\n</div>\r\n<dl class=\"custom-page privacy-policy-page\">\r\n    <dt class=\"heading-2\">Informação geral</dt>\r\n    <dd>Bem-vindo à nossa página de Política de Privacidade! Quando você usa nossos serviços de loja, você nos confia suas informações. Esta Política de Privacidade tem como objetivo ajudá-lo a compreender quais dados coletamos, por que os coletamos e o que fazemos com eles. Quando você compartilha informações conosco, podemos tornar nossos serviços ainda melhores para você. Por exemplo, podemos mostrar a você resultados de pesquisa e anúncios mais relevantes, ajudá-lo a se conectar com as pessoas ou tornar o compartilhamento com outras pessoas mais rápido e fácil. Ao usar nossos serviços, queremos que seja claro como estamos usando as informações e como você pode proteger sua privacidade. Isso é importante; esperamos que você reserve um tempo para lê-lo com atenção. Lembre-se de que você pode encontrar controles para gerenciar suas informações e proteger sua privacidade e segurança. Tentamos mantê-lo o mais simples possível.</dd>\r\n    <dt class=\"heading-2\">Direito de acessar, corrigir e excluir dados e de se opor ao processamento de dados</dt>\r\n    <dd>Os nossos clientes têm o direito de aceder, corrigir e eliminar os dados pessoais que lhes digam respeito e de se opor ao tratamento desses dados, mediante pedido por escrito, a qualquer momento. A Empresa faz todos os esforços para adotar as precauções adequadas para salvaguardar a segurança e a privacidade dos dados pessoais e para evitar que sejam alterados, corrompidos, destruídos ou acessados ​​por terceiros não autorizados. No entanto, a Empresa não controla todo e qualquer risco relacionado ao uso da Internet e, portanto, alerta os usuários do Site sobre os riscos potenciais envolvidos no funcionamento e uso da Internet. O Site pode incluir links para outros sites ou outras fontes da Internet. Como a Empresa não pode controlar esses sites e fontes externas, a Empresa não pode ser responsabilizada pelo fornecimento ou exibição desses sites e fontes externas, e não pode ser responsabilizada pelo conteúdo, publicidade, produtos, serviços ou qualquer outro material disponíveis nesses sites ou em fontes externas.</dd>\r\n    <dt class=\"heading-2\">Gestão de dados pessoais</dt>\r\n    <dd>Você pode visualizar ou editar seus dados pessoais online para muitos de nossos serviços. Você também pode fazer escolhas sobre nossa coleta e uso de seus dados. Como você pode acessar ou controlar seus dados pessoais dependerá de quais serviços você usa. Você pode escolher se deseja receber comunicações promocionais de nossa loja por e-mail, SMS, correio físico e telefone. Se você receber e-mails promocionais ou mensagens SMS de nossa parte e desejar cancelar o recebimento, siga as instruções na mensagem. Você também pode fazer escolhas sobre o recebimento de e-mail promocional, chamadas telefônicas e correio, visitando e fazendo login no Company Promotional Communications Manager, que permite atualizar as informações de contato, gerenciar preferências de contato, cancelar assinaturas de e-mail e escolher compartilhe suas informações de contato com nossos parceiros. Essas opções não se aplicam às comunicações de serviço obrigatórias que fazem parte de determinados serviços da loja.</dd>\r\n    <dt class=\"heading-2\">Informações que coletamos</dt>\r\n    <dd>Nossa loja coleta dados para operar de forma eficaz e fornecer a você as melhores experiências com nossos serviços. Você fornece alguns desses dados diretamente, por exemplo, quando cria uma conta pessoal. Algumas delas são obtidas registrando como você interage com nossos serviços, por exemplo, usando tecnologias como cookies e recebendo relatórios de erros ou dados de uso de software executado em seu dispositivo. Também obtemos dados de terceiros (incluindo outras empresas). Por exemplo, complementamos os dados que coletamos comprando dados demográficos de outras empresas. Também usamos serviços de outras empresas para nos ajudar a determinar um local com base em seu endereço IP, a fim de personalizar certos serviços para sua localização. Os dados que coletamos dependem dos serviços e recursos que você usa.</dd>\r\n    <dt class=\"heading-2\">Como usamos suas informações</dt>\r\n    <dd>Nossa loja usa os dados que coletamos para três finalidades básicas: operar nosso negócio e fornecer (incluindo melhorar e personalizar) os serviços que oferecemos, enviar comunicações, incluindo comunicações promocionais, e exibir publicidade. Ao cumprir esses objetivos, combinamos os dados que coletamos por meio dos vários serviços de loja que você usa para oferecer uma experiência mais integrada, consistente e personalizada. No entanto, para aumentar a privacidade, criamos salvaguardas tecnológicas e processuais projetadas para evitar certas combinações de dados. Por exemplo, armazenamos dados que coletamos de você quando você não está autenticado (não está conectado) separadamente de qualquer informação de conta que o identifique diretamente, como seu nome, endereço de e-mail ou número de telefone.</dd>\r\n    <dt class=\"heading-2\">Compartilhando suas informações</dt>\r\n    <dd>Compartilhamos seus dados pessoais com o seu consentimento ou conforme necessário para concluir qualquer transação ou fornecer qualquer serviço que você tenha solicitado ou autorizado. Por exemplo, compartilhamos seu conteúdo com terceiros quando você nos diz para fazê-lo. Quando você fornece dados de pagamento para fazer uma compra, compartilharemos os dados de pagamento com bancos e outras entidades que processam transações de pagamento ou fornecem outros serviços financeiros e para prevenção de fraude e redução de risco de crédito. Além disso, compartilhamos dados pessoais entre nossas afiliadas e subsidiárias controladas. Também compartilhamos dados pessoais com fornecedores ou agentes que trabalham em nosso nome para os fins descritos nesta declaração. Por exemplo, empresas que contratamos para fornecer suporte de atendimento ao cliente ou auxiliar na proteção e segurança de nossos sistemas e serviços podem precisar de acesso a dados pessoais para fornecer essas funções. Nesses casos, essas empresas devem obedecer aos nossos requisitos de privacidade e segurança de dados e não estão autorizadas a usar os dados pessoais que recebem de nós para qualquer outra finalidade. Também podemos divulgar dados pessoais como parte de uma transação corporativa, como uma fusão ou venda de ativos.</dd>\r\n</dl>', '2017-10-21 02:06:13', '2020-10-01 13:48:44', 1, 0, '', '', '', NULL, NULL, NULL, ''),
(5, 'Atendimento ao Cliente', '1column', '', '', 'customer-service', ' Customer Service', '<div class=\"customer-service\">\r\n    <div class=\"text-block customer-service__block\">\r\n        <h3>Entrega</h3>\r\n        <h4>Olá, bem-vindo à página de informações de envio e entrega! Aqui você pode se familiarizar com informações úteis sobre os termos\r\ne condições de nossa entrega de mercadorias</h4>\r\n        <p>Você pode comprar seus itens online e retirá-los em nossa loja de rua ou enviá-los diretamente à sua porta. O envio é gratuito em alguns pedidos. Usamos as melhores transportadoras do mercado para garantir que seu pedido chegue a tempo. Na página Check-out seguro, você verá a descrição, preço e prazo de entrega do seu item. Quando disponível, você também pode escolher um método de entrega mais rápido para cada item de seu pedido, por uma taxa adicional. Os prazos de entrega variam de acordo com o endereço de entrega selecionado, a disponibilidade dos itens e a hora do dia em que você faz o pedido.</p>\r\n    </div>\r\n    <div class=\"table-block  customer-service__block\">\r\n        <h3>Custo</h3>\r\n        <div class=\"table-block_wrapper\">\r\n            <table>\r\n                <thead>\r\n                    <th>Serviços</th>\r\n                    <th>Localizações</th>\r\n                    <th>Agenda de entrega</th>\r\n                    <th>Custo por envio</th>\r\n                </thead>\r\n                <tbody>\r\n                    <tr>\r\n                        <td>Royal mail 1st Class Service (Order value $20 or less)</td>\r\n                        <td>All of UK & some European Countries</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$5</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Royal mail Tracker (Order value $50 or less)</td>\r\n                        <td>All of UK</td>\r\n                        <td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\r\n                        <td>$45</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Standard Courier Delivery</td>\r\n                        <td>UK mainland only</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$124</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Standard Courier Delivery</td>\r\n                        <td>Northern Ireland, Eire, Scilly Isles</td>\r\n                        <td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\r\n                        <td>$11</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Royal mail 1st Class Service (Order value $20 or less)</td>\r\n                        <td>All of UK & some European Countries</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$5</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Priority courier pre 12pm Next Working Day</td>\r\n                        <td>UK mainland only</td>\r\n                        <td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\r\n                        <td>$89</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Royal mail 1st Class Service (Order value $20 or less)</td>\r\n                        <td>All of UK & some European Countries</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$72</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>            \r\n        </div>\r\n    </div>\r\n    <div class=\"text-block  customer-service__block\">\r\n        <h3>Free Delivery</h3>\r\n        <p>Free two-day shipping is available on in-stock items. You can see in your bag if your item is in stock. Free two-day shipping is not available on customized, engraved products, and for certain order types, including orders paid for with financing or by bank transfer. To get free two-day shipping, you will need to place your order by 5pm, Monday to Friday. For instance, if you order your goods before 5:00 pm, Monday to Friday we will deliver them in two business days.</p>\r\n    </div>\r\n    <div class=\"list-block  customer-service__block\">\r\n        <h3>Terms & Conditions</h3>\r\n        <ul class=\"row\">\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\nvar headertext = [];\r\nvar headers = document.querySelectorAll(\".table-block thead\");\r\nvar tablebody = document.querySelectorAll(\".table-block tbody\");\r\n\r\nfor (var i = 0; i < headers.length; i++) {\r\n    headertext[i]=[];\r\n    for (var j = 0, headrow; headrow = headers[i].rows[0].cells[j]; j++) {\r\n      var current = headrow;\r\n      headertext[i].push(current.textContent);\r\n      }\r\n} \r\n\r\nfor (var h = 0, tbody; tbody = tablebody[h]; h++) {\r\n    for (var i = 0, row; row = tbody.rows[i]; i++) {\r\n      for (var j = 0, col; col = row.cells[j]; j++) {\r\n        col.setAttribute(\"data-th\", headertext[h][j]);\r\n      } \r\n    }\r\n}\r\n</script>', '2017-11-25 16:52:19', '2020-10-01 13:51:37', 1, 0, '', '', '', NULL, NULL, NULL, ''),
(6, 'Sobre nós', '1column', '', '', 'about-us', 'About Us', '<div class=\"about-us-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2 col-sm-12 \">\r\n       <img src=\"{{media url=&quot;wysiwyg/1.jpg&quot;}}\" alt=\"\" />\r\n        <p>\r\n            Se falarmos sobre nossa fundadora, Mary Harris, seu interesse por móveis e tudo relacionado a ele começou na loja de cadeiras e mesas local de seu pai na Virgínia ... Começando como sua ajudante e contadora, ela finalmente passou a gostar de tudo e começou a considerar a opção de abrir sua própria loja de móveis na cidade grande. Com sua primeira loja em Arlington em 1999, a rede de Mary começou a se expandir gradualmente, agora consistindo em mais de 5 lojas de móveis em todo o país ... Vendemos apenas os melhores conjuntos e peças de móveis, fabricados nos EUA, Canadá ou Reino Unido ... Toda a nossa gama inclui apenas marcas com reputação duradoura, que se provaram populares entre as pessoas durante anos ...\r\n        </p>\r\n        <p>\r\n            Máxima qualidade e conforto <br> Quando procura um sofá ou uma cadeira, o conforto e a durabilidade têm de estar em primeiro lugar! Com a nossa gama de confortáveis ​​espreguiçadeiras, poltronas reclináveis ​​e muitas outras peças podemos garantir que irá encontrar!\r\n        </p>\r\n        <p>\r\n            Preço aceitável para uma ótima qualidade <br> A política de preços que implementamos torna a acessibilidade um ponto central ... Enquanto para algumas pessoas a qualidade significa um custo altíssimo, para nós o equilíbrio entre os dois é facilmente alcançado.\r\n        </p>     \r\n    </div>\r\n</div>', '2017-11-25 16:53:02', '2020-10-01 13:53:46', 1, 0, '', '', '', NULL, NULL, NULL, ''),
(7, ' Envio e entrega', '1column', '', '', 'shipping-delivery', 'Shipping & Delivery', '<div class=\"shipping-delivery-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <p>\r\n            Então você fez suas compras; quanto tempo vai demorar até que você possa arrasar com aquela nova skin de laptop com tema Axolotl? A calculadora abaixo fornecerá a quantidade média de dias que leva para enviar um produto até sua porta e o melhor tempo para entrar em contato com nossa equipe de suporte. Observe que todos os pedidos na Redbubble são impressos personalizados apenas para você e levará de 1 a 3 dias úteis para serem impressos antes do envio.\r\n        </p>\r\n        <span class=\"heading-3\">Aqui estão algumas coisas a serem consideradas enquanto você espera pelo seu pedido:</span>\r\n        <ul>\r\n            <li><span>Enviamos em dias úteis. De segunda a sexta, exceto feriados nacionais.</span></li>\r\n            <li><span>O envio começa na data em que você recebeu a mensagem “Seu pedido foi enviado!” o email.</span></li>\r\n            <li><span>A estimativa acima não inclui o tempo de fabricação - precisamos de 1 a 3 dias úteis para garantir que seu pedido personalizado seja tudo o que você esperava.</span></li>\r\n        </ul>\r\n        <p>\r\n            Redbubble é uma empresa global - trabalhamos com parceiros de produção e envio em todo o mundo para levar suas coisas até sua porta, onde quer que esteja. Embora a grande maioria de nossos clientes receba seus pedidos nos dias listados acima, os prazos reais podem variar de região para região.\r\n        </p>\r\n        <div class=\"shipping-delivery-page__border\">\r\n            <span class=\"heading-3\">So when do you contact Redbubble?</span>\r\n            <span>The calculator above lets you know the best time to message us. When that day rolls around.</span>\r\n            <span>Even if your order hasn’t arrived by the listed date, it’s probably still on its way (and worth the wait).</span>\r\n        </div>\r\n        <ol class=\"shipping-delivery-page__list\">\r\n            <li>\r\n                <span class=\"heading-3 shipping-delivery-page_shipping-icon\">How much is shipping?</span>\r\n                <p>Once you’ve clicked through to Secure Checkout, you can enter your delivery address and choose a shipping method. Shipping costs are then calculated and tacked on to your subtotal at the bottom of the page.</p>\r\n            </li>\r\n            <li>\r\n                <span class=\"heading-3 shipping-delivery-page_track-icon\">Can I track my order?</span>\r\n                <p>We rely on a global network of shipping partners (UPS, FedEx, DHL) as well as local postal services (USPS) to get your order to your doorstep as soon as possible. For this reason, tracking is not always available. If your order is being sent by a trackable service, these details will be included on your orders page as well as on the shipping email we send you.</p>\r\n            </li>\r\n            <li>\r\n                <span class=\"heading-3 shipping-delivery-page_order-icon\">Where does my order ship from?</span>\r\n                <p>We rely on a global network of shipping partners (UPS, FedEx, DHL) as well as local postal services (USPS) to get your order to your doorstep as soon as possible. For this reason, tracking is not always available. If your order is being sent by a trackable service, these details will be included on your orders page as well as on the shipping email we send you.</p>\r\n            </li>\r\n        </ol>\r\n    </div>\r\n</div>', '2017-11-25 16:53:09', '2020-10-01 13:55:46', 1, 0, '', '', '', NULL, NULL, NULL, ''),
(9, 'FAQ', '1column', '', '', 'faq', 'FAQ', '<div class=\"faq-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <div id=\"faq-accordion\">\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Is it necessary for me to register an account in order to buy an item?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Which shipping providers do you use?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>How long it will take to receive the furniture?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>How long it will take to receive the furniture?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Do you offer any kind of discounts?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Do you accept orders from all 50 US states?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>', '2017-11-25 16:55:09', '2017-11-25 16:55:09', 1, 0, '', '', '', NULL, NULL, NULL, ''),
(10, 'Support', '1column', '', '', 'support', 'Support', '<div class=\"support-page\">\r\n    <div>\r\n        <div class=\"text-block\">\r\n            <p>Our customer support department is ready to come to your aid in a 24/7 manner, be your request in a form on email ticket or a phone call... We have a team of professional managers who will consult you regarding any technical, in-stock or billing question you might have. Also, should there be any problems with the delivery or if you would want to file a return, we will help you as well!</p>\r\n        </div>\r\n        <div class=\"boxes-block\">\r\n            <h3>Have a Question?</h3>\r\n            <ul class=\"row\">\r\n                <li class=\"col-md-6\"><a href=\"#\"><div>\r\n                    <span class=\"support-page__archive-icon\">Knowledge Base</span>\r\n                </div></a></li>\r\n                <li class=\"col-md-6\"><a href=\"#\"><div>\r\n                    <span class=\"support-page__bubbles-icon\">Community Forum</span>\r\n                </div></a></li>\r\n                <li class=\"col-md-6\"><a href=\"#\"><div>\r\n                    <span class=\"support-page__bubble-question-icon\">24/7Ticket Support</span>\r\n                </div></a></li>\r\n                <li class=\"col-md-6\"><a href=\"#\"><div>\r\n                    <span class=\"support-page__envelope-icon\">Contact us</span>\r\n                </div></a></li>\r\n            </ul>\r\n        </div>        \r\n    </div>\r\n</div>\r\n', '2017-11-25 16:55:27', '2019-03-25 15:23:52', 1, 0, '', '', '', NULL, NULL, NULL, ''),
(11, 'Guarantee', '1column', '', '', 'guarantee', 'Guarantee & After-Sales Service', '<div class=\"guarantee-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <div class=\"text-block\">\r\n            <p>Quite often, even after we’ve chosen an item and purchased it successfully, there may be some things we might want to change or repair afterward - either during or following the delivery process, when filing a return or applying for using our warranty. Here we\'ll try to explain in plain terms how does our store’s warranty policy works and how you can be using it when shopping with us!</p>\r\n        </div>\r\n        <div class=\"text-block\">\r\n            <h3>What Products are Provided with the Warranty?</h3>\r\n            <p>Some of our furniture items apply for an almost unconditional Lifetime Warranty. The items included in this policy are sofas, couches, love seats, upholstered chairs, ottomans, sectionals, and sleepers. As a retailer we warrant these components to you, the original retail purchaser, to be free from material manufacturing defects. The lifetime duration of the Warranty means the standardized usage cycle for a specific furniture item.</p>\r\n            <ul>\r\n                <li>\r\n                    <h4>Repair & Refurbishing</h4>\r\n                    <span>Our store will pay, within one year from the date of purchase, reasonable and conditional labor rates for refurbishing or replacing the defective parts and shipping costs.</span>\r\n                </li>\r\n                <li>\r\n                    <h4>Different Types of Warranty</h4>\r\n                    <span>While for some items we have a lifetime warranty, the springs in all of our items are offered with a 5 Year Limited type of a Warranty.</span>\r\n                </li>\r\n                <li>\r\n                    <h4>Warranty Exceptions</h4>\r\n                    <span>All seat cushion cores have a natural tendency to become softer during a normal usage cycle, and will conform to the shape of the user. A Limited 1 Year Warranty applies.</span>\r\n                </li>\r\n            </ul>\r\n        </div>\r\n        <div class=\"text-block\">\r\n            <h3>Where to Apply for Warranty Services?</h3>\r\n            <p>Under these Limited Warranties, all of the legal liability of our store is limited to repair, or  if required (or requested by the customer), replacement. We are  ready to pay, within one year from the date of purchase, reasonable and customary labor rates to repair or replace the defective parts and shipping costs from the retailer...</p>\r\n            <p>These Limited Warranties are not applicable for any of our products which ave been altered by any person, dealer, or company without the express written authorization of our store. PLease note, that some States Do Not Allow Limitations On How Long An Implied Warranty Lasts, So The Above Limitations May Not Apply To You.</p>\r\n        </div>\r\n        <div class=\"text-block\">\r\n            <h3>In What Cases the Warranty is Not Provided?</h3>\r\n            <p>There can be two limits for the Warranties issued with the purchase of the furniture items on our website.</p>\r\n            <ul class=\"row\">\r\n                <li class=\"col-md-6\">\r\n                    <h4>1, 3 & 5 Years Limited Warranty</h4>\r\n                    <span>The first one is the Warranty time frame, if it is limited to 1, 3 or 5 years. Hence the Lifetime Warranty is not time-restricted.</span>\r\n                </li>\r\n                <li class=\"col-md-6\">\r\n                    <h4>Regular Usage Check</h4>\r\n                    <span>The second one is the examination of the item by our customer support agent, making sure the usage was regular.</span>\r\n                </li>\r\n            </ul>\r\n        </div>\r\n        <div class=\"text-block\">\r\n            <h3>Change and Return</h3>\r\n            <p>Filing a change or a return is an easy process, requiring nothing more than your proof of purchase (which usually is the receipt you received), the item itself and the return label printed out by you and put at the top of the package...</p>\r\n        </div>    \r\n    </div>\r\n</div>', '2017-11-25 16:55:56', '2017-11-25 16:55:56', 1, 0, '', '', '', NULL, NULL, NULL, ''),
(12, 'Secure payment', '1column', '', '', 'secure-payment', 'Secure payment', '<div class=\"secure-payment-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <p>\r\n            When it comes to purchasing something, anything online, the security question towers above everything else. We do not take our store’s overall cyber security and particularly the billing process security lightly. We can assure you that all of your shopping here will be a fun and safe experience, enhanced by the all of the factors listed below.\r\n        </p>\r\n        <ul>\r\n            <li>\r\n                <h4>SSL Certificate</h4>\r\n                <span>If the website has an SLL certificate, this means that the owners care about your shopping experience being secure, safe and sound and want to make sure that all the data (including financial) that you enter on our website will be securely encrypted!</span>\r\n            </li>\r\n            <li>\r\n                <h4>Multiple Gateways</h4>\r\n                <span>When we were considering which payment gateways to use on our website, the choice narrowed down to 5 most universal ones: Visa; MasterCard; PayPal; Discover; Stripe.</span>\r\n            </li>\r\n            <li>\r\n                <h4>24/7 Customer Support</h4>\r\n                <span>Also, it is comforting to know that should you experience any kind of technical bump in the road during the checkout process, you can always address our customer support department with your billing questions!</span>\r\n            </li>\r\n        </ul>\r\n        <div class=\"secure-payment_icons\">\r\n            <ul>\r\n                <li><a href=\"#\" class=\"fa fa-cc-visa\"></a></li>\r\n                <li><a href=\"#\" class=\"fa fa-cc-mastercard\"></a></li>\r\n                <li><a href=\"#\" class=\"fa fa-cc-paypal\"></a></li>\r\n                <li><a href=\"#\" class=\"fa fa-cc-discover\"></a></li>\r\n                <li><a href=\"#\" class=\"fa fa-cc-stripe\"></a></li>\r\n            </ul>\r\n        </div>\r\n    </div>\r\n</div>', '2017-11-25 16:56:34', '2017-11-25 16:56:34', 1, 0, '', '', '', NULL, NULL, NULL, ''),
(13, 'Terms & Conditions', '1column', '', '', 'terms-conditions', 'Terms & Conditions', '<div class=\"terms-conditions-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <div class=\"text-block\">\r\n            <p>This Policy is projected to all personal information and sensitive personal data or information that is given by or obtained from any person who visits or uses or accesses the website (\"User\"). We reserve the right to modify or review the details of this Policy without prior notice and the revised Policy will be in effect from the day of uploading.  Therefore, Users are requested to periodically visit the website and review the policy.</p>\r\n            <ul>\r\n                <li>\r\n                    <h4>Rule 1</h4>\r\n                    <p>A User may be required to give away some Personal Information, including Sensitive Personal Information while browsing through the website or for availing services at the website.\r\n</p>\r\n                </li>\r\n                <li>\r\n                    <h4>Rule 2</h4>\r\n                    <p>Personal Information disclosed to Us by a User will be used by Us for one or more of the following purposes: (a) to help Us in creating content that is relevant to the User; (b)  to collect a database of all the Personal Information collected from User</p>\r\n                </li>\r\n                <li>\r\n                    <h4>Rule 3</h4>\r\n                    <p>When a User visits the website, one or more cookies shall be sent to a computer or the device being used by the User to visit the websites. Cookies are used upscale the quality of the services provided by Us, including for keeping User preferences...</p>\r\n                </li>\r\n            </ul>\r\n        </div>        \r\n    </div>\r\n</div>', '2017-11-25 16:56:56', '2017-11-25 16:56:56', 1, 0, '', '', '', NULL, NULL, NULL, ''),
