INSERT INTO `email_template` (`template_id`, `template_code`, `template_text`, `template_styles`, `template_type`, `template_subject`, `template_sender_name`, `template_sender_email`, `added_at`, `modified_at`, `orig_template_code`, `orig_template_variables`) VALUES
(1, 'Nova Ordem de Pedido', '<!--@subject {{trans \"Your %store_name order confirmation\" store_name=$store.getFrontendName()}} @-->\r\n<!--@vars {\r\n\"var order.getCustomerName()\":\"Customer Name\",\r\n\"var store.getFrontendName()\":\"Customer Name\",\r\n\"var is_pickup_order\":\"Check if order is a pickup order\",\r\n\"var $this.getUrl($store,\'customer/account/\',[_nosid:1]) |raw\":\"Gets the link to the Customer Account\",\r\n\"var store_email |raw\":\"Defined Email Address for this type of mails\",\r\n\"var store_phone |raw\":\"Defined Phone Number in the Store Information\",\r\n\"var store_hours |raw\":\"Defined Opening Hours Phone Number in the Store Information\",\r\n\"var order.increment_id |raw\":\"Order Id\",\r\n\"var order.getCreatedAtFormatted(2) |raw\":\"Get the date of order creation\",\r\n\"var order.getEmailCustomerNote()\":\"Email Order Note\",\r\n\"var formattedBillingAddress|raw\":\"Billing Address\",\r\n\"var order.getIsNotVirtual()\":\"Check if shipment exists\",\r\n\"var pickupAddress|raw\":\"Pickup Location Address\",\r\n\"var formattedShippingAddress|raw\":\"Customer Shipping Address\",\r\n\"var payment_html|raw\":\"Payment Details\",\r\n\"var order.getShippingDescription()\":\"Shipping Description\",\r\n\"var shipping_msg\":\"Shipping message\",\r\n\"layout handle=\\\"sales_email_order_items\\\" order=$order area=\\\"frontend\\\"\":\"Order Items Grid\"\r\n} @-->\r\n\r\n{{template config_path=\"design/email/header_template\"}}\r\n\r\n<table>\r\n    <tr class=\"email-intro\">\r\n        <td>\r\n            <p class=\"greeting\">{{trans \"%customer_name,\" customer_name=$order.getCustomerName()}}</p>\r\n            <p>\r\n                {{trans \"Thank you for your order from %store_name.\" store_name=$store.getFrontendName()}}\r\n                {{if is_pickup_order}}\r\n                    {{trans \"We will send you a notification once your items are ready for pickup.\"}}\r\n                {{else}}\r\n                    {{trans \"Once your package ships we will send you a tracking number.\"}}\r\n                {{/if}}\r\n                {{trans \'You can check the status of your order by <a href=\"%account_url\">logging into your account</a>.\' account_url=$this.getUrl($store,\'customer/account/\',[_nosid:1]) |raw}}\r\n            </p>\r\n            <p>\r\n                {{trans \'If you have questions about your order, you can email us at <a href=\"mailto:%store_email\">%store_email</a>\' store_email=$store_email |raw}}{{depend store_phone}} {{trans \' or call us at <a href=\"tel:%store_phone\">%store_phone</a>\' store_phone=$store_phone |raw}}{{/depend}}.\r\n                {{depend store_hours}}\r\n                {{trans \'Our hours are <span class=\"no-link\">%store_hours</span>.\' store_hours=$store_hours |raw}}\r\n                {{/depend}}\r\n            </p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"email-summary\">\r\n        <td>\r\n            <h1>{{trans \'Your Order <span class=\"no-link\">#%increment_id</span>\' increment_id=$order.increment_id |raw}}</h1>\r\n            <p>{{trans \'Placed on <span class=\"no-link\">%created_at</span>\' created_at=$order.getCreatedAtFormatted(2) |raw}}</p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"email-information\">\r\n        <td>\r\n            {{depend order.getEmailCustomerNote()}}\r\n            <table class=\"message-info\">\r\n                <tr>\r\n                    <td>\r\n                        {{var order.getEmailCustomerNote()|escape|nl2br}}\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n            {{/depend}}\r\n            <table class=\"order-details\">\r\n                <tr>\r\n                    <td class=\"address-details\">\r\n                        <h3>{{trans \"Billing Info\"}}</h3>\r\n                        <p>{{var formattedBillingAddress|raw}}</p>\r\n                    </td>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"address-details\">\r\n                        <h3>{{trans \"Shipping Info\"}}</h3>\r\n                        {{if is_pickup_order}}\r\n                            <h4>{{trans \"Pickup Location\"}}</h4>\r\n                            <p>{{var pickupAddress|raw}}</p>\r\n                            <h4>{{trans \"Recipient Address\"}}</h4>\r\n                        {{/if}}\r\n                        <p>{{var formattedShippingAddress|raw}}</p>\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n                <tr>\r\n                    <td class=\"method-info\">\r\n                        <h3>{{trans \"Payment Method\"}}</h3>\r\n                        {{var payment_html|raw}}\r\n                    </td>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"method-info\">\r\n                        <h3>{{trans \"Shipping Method\"}}</h3>\r\n                        <p>{{var order.getShippingDescription()}}</p>\r\n                        {{if shipping_msg}}\r\n                        <p>{{var shipping_msg}}</p>\r\n                        {{/if}}\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n            </table>\r\n            {{layout handle=\"sales_email_order_items\" order=$order area=\"frontend\"}}\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer_template\"}}\r\n', NULL, 2, '{{trans \"Your %store_name order confirmation\" store_name=$store.getFrontendName()}}', NULL, NULL, '2019-03-20 08:42:31', '2020-10-02 14:33:53', 'sales_email_order_template', '{\"var formattedBillingAddress|raw\":\"Billing Address\",\"var order.getEmailCustomerNote()\":\"Email Order Note\",\"var order.increment_id\":\"Order Id\",\"layout handle=\\\"sales_email_order_items\\\" order=$order area=\\\"frontend\\\"\":\"Order Items Grid\",\"var payment_html|raw\":\"Payment Details\",\"var formattedShippingAddress|raw\":\"Shipping Address\",\"var order.getShippingDescription()\":\"Shipping Description\",\"var shipping_msg\":\"Shipping message\"}'),
(2, 'New Pickup Order For Guest', '<!--@subject {{trans \"Your %store_name order confirmation\" store_name=$store.getFrontendName()}} @-->\n<!--@vars {\n\"var order.getBillingAddress().getName()\":\"Guest Customer Name\",\n\"var store.getFrontendName()\":\"Customer Name\",\n\"var is_pickup_order\":\"Check if order is a pickup order\",\n\"var store_email |raw\":\"Defined Email Address for this type of mails\",\n\"var store_phone |raw\":\"Defined Phone Number in the Store Information\",\n\"var store_hours |raw\":\"Defined Opening Hours Phone Number in the Store Information\",\n\"var order.increment_id |raw\":\"Order Id\",\n\"var order.getCreatedAtFormatted(2) |raw\":\"Get the date of order creation\",\n\"var order.getEmailCustomerNote()\":\"Email Order Note\",\n\"var formattedBillingAddress|raw\":\"Billing Address\",\n\"var order.getIsNotVirtual()\":\"Check if shipment exists\",\n\"var pickupAddress|raw\":\"Pickup Location Address\",\n\"var formattedShippingAddress|raw\":\"Customer Shipping Address\",\n\"var payment_html|raw\":\"Payment Details\",\n\"var order.getShippingDescription()\":\"Shipping Description\",\n\"var shipping_msg\":\"Shipping message\",\n\"layout handle=\\\"sales_email_order_items\\\" order=$order area=\\\"frontend\\\"\":\"Order Items Grid\"\n} @-->\n\n{{template config_path=\"design/email/header_template\"}}\n\n<table>\n    <tr class=\"email-intro\">\n        <td>\n            <p class=\"greeting\">{{trans \"%name,\" name=$order.getBillingAddress().getName()}}</p>\n            <p>\n                {{trans \"Thank you for your order from %store_name.\" store_name=$store.getFrontendName()}}\n                {{if is_pickup_order}}\n                    {{trans \"We will send you a notification once your items are ready for pickup.\"}}\n                {{else}}\n                    {{trans \"Once your package ships we will send an email with a link to track your order.\"}}\n                {{/if}}\n                {{trans \'If you have questions about your order, you can email us at <a href=\"mailto:%store_email\">%store_email</a>\' store_email=$store_email |raw}}{{depend store_phone}} {{trans \' or call us at <a href=\"tel:%store_phone\">%store_phone</a>\' store_phone=$store_phone |raw}}{{/depend}}.\n                {{depend store_hours}}\n                    {{trans \'Our hours are <span class=\"no-link\">%store_hours</span>.\' store_hours=$store_hours |raw}}\n                {{/depend}}\n            </p>\n        </td>\n    </tr>\n    <tr class=\"email-summary\">\n        <td>\n            <h1>{{trans \'Your Order <span class=\"no-link\">#%increment_id</span>\' increment_id=$order.increment_id |raw}}</h1>\n            <p>{{trans \'Placed on <span class=\"no-link\">%created_at</span>\' created_at=$order.getCreatedAtFormatted(2) |raw}}</p>\n        </td>\n    </tr>\n    <tr class=\"email-information\">\n        <td>\n            {{depend order.getEmailCustomerNote()}}\n            <table class=\"message-info\">\n                <tr>\n                    <td>\n                        {{var order.getEmailCustomerNote()|escape|nl2br}}\n                    </td>\n                </tr>\n            </table>\n            {{/depend}}\n            <table class=\"order-details\">\n                <tr>\n                    <td class=\"address-details\">\n                        <h3>{{trans \"Billing Info\"}}</h3>\n                        <p>{{var formattedBillingAddress|raw}}</p>\n                    </td>\n                    {{depend order.getIsNotVirtual()}}\n                    <td class=\"address-details\">\n                        <h3>{{trans \"Shipping Info\"}}</h3>\n                        {{if is_pickup_order}}\n                            <h4>{{trans \"Pickup Location\"}}</h4>\n                            <p>{{var pickupAddress|raw}}</p>\n                            <h4>{{trans \"Recipient Address\"}}</h4>\n                        {{/if}}\n                        <p>{{var formattedShippingAddress|raw}}</p>\n                    </td>\n                    {{/depend}}\n                </tr>\n                <tr>\n                    <td class=\"method-info\">\n                        <h3>{{trans \"Payment Method\"}}</h3>\n                        {{var payment_html|raw}}\n                    </td>\n                    {{depend order.getIsNotVirtual()}}\n                    <td class=\"method-info\">\n                        <h3>{{trans \"Shipping Method\"}}</h3>\n                        <p>{{var order.getShippingDescription()}}</p>\n                        {{if shipping_msg}}\n                        <p>{{var shipping_msg}}</p>\n                        {{/if}}\n                    </td>\n                    {{/depend}}\n                </tr>\n            </table>\n            {{layout handle=\"sales_email_order_items\" order=$order}}\n        </td>\n    </tr>\n</table>\n\n{{template config_path=\"design/email/footer_template\"}}\n', NULL, 2, '{{trans \"Your %store_name order confirmation\" store_name=$store.getFrontendName()}}', NULL, NULL, '2019-03-20 08:42:32', '2019-03-20 08:42:32', 'sales_email_order_guest_template', '{\"var formattedBillingAddress|raw\":\"Billing Address\",\"var order.getEmailCustomerNote()\":\"Email Order Note\",\"var order.getBillingAddress().getName()\":\"Guest Customer Name\",\"var order.getCreatedAtFormatted(2)\":\"Order Created At (datetime)\",\"var order.increment_id\":\"Order Id\",\"layout handle=\\\"sales_email_order_items\\\" order=$order\":\"Order Items Grid\",\"var payment_html|raw\":\"Payment Details\",\"var formattedShippingAddress|raw\":\"Shipping Address\",\"var order.getShippingDescription()\":\"Shipping Description\",\"var shipping_msg\":\"Shipping message\"}'),
