INSERT INTO `tm_blog_post` (`post_id`, `is_visible`, `identifier`, `title`, `tags`, `author`, `content`, `short_content`, `meta_keywords`, `meta_description`, `creation_time`, `update_time`, `image`, `comments_enabled`) VALUES
(13, 1, 'what-is-offered-in-this-online-store', 'What is offered in this online store? ', NULL, 'Bernard Show', '<img src=\"{{media url=\"wysiwyg/2.jpg\"}}\" alt=\"2\" />\r\nBefore you start off to the website, answer one question: what is it that you pursue when choosing your lingerie? Is it soothing comfort or breathtaking seductive power? \r\nEvery woman knows that her most sophisticated and impressive outfit is not complete without perfect lingerie underneath. Just as an old joke says, “She was wearing all white, but no one could see that, as there was a black dress on her”.  \r\nLingerie is more than just a garment. For some reason, it is often considered to be a topic which is not appropriate to be talked about. However, it deserves just as much attention as usual clothing. It may be fashionable or not, it may be comfortable or not,  it may suit you or not. This is why it should be talked about, paid attention to and enjoyed. \r\n\r\nWe advocate comfortable, elegant and beautiful lingerie. A feeling of comfort comes from inside, and lingerie is the closest thing to your body. We provide you with the best models which combine both function and design, and all you have to do is choose the items which are perfect for you. \r\n\r\nWe know how difficult it is to choose your perfect bra. Here you’ll find extremely elegant wire, non-wired, padded bras, push-up and minimizer bras. Use a Lingerie Finder to find the item which you are looking for, as an array of products is so big that you may simply get lost before you find a desired item. \r\n\r\nMost comfortable sleepwear, extremely elegant swimwear, seductive lingerie, regular and plus size shapewear and so on. An extensive range of lingerie includes naughty and nice models. Be sure that whichever evening you are planning, in the lingerie which fits your body perfectly, which is comfortable and at the same time makes you look gorgeous, it will be amazing. Either it’s a special moment with your loved one, or a gathering with your friends at a tennis court, the lingerie which you’ll be wearing will make you as comfortable as possible. \r\n', 'Before you start off to the website, answer one question: what is it that you pursue when choosing your lingerie? Is it soothing comfort or breathtaking seductive power? ', NULL, NULL, '2016-10-07 18:00:00', '2017-12-26 10:52:58', 'tm_blog/2/_/2.jpg', 1),
