INSERT INTO `tm_brand` (`brand_id`, `name`, `status`, `url_key`, `title`, `logo`, `brand_banner`, `product_banner`, `short_description`, `main_description`, `meta_keywords`, `meta_description`, `website_id`) VALUES
(1, 'Triumph', 1, 'triumph', 'Triumph', '1406AW_FSP_FF_Brands_Lingerie_Logo3_1.jpg', NULL, '1406AW_FSP_FF_Brands_Lingerie_Logo3.jpg', 'Triumph International is a multinational family-owned underwear and lingerie manufacturer founded in 1886 in Heubach', 'Triumph International is a multinational family-owned underwear and lingerie manufacturer founded in 1886 in Heubach, \r\nIn 2016 Triumph celebrates 130 years of creativity, innovation and dedication by continuing to set industry standards in its core competence of best fit, derived from a deep knowledge and understanding of the female body.\r\nTriumph today enjoys a presence in over 120 countries all across the world. For its brands Triumph and sloggi the company develops, produces and sells underwear, lingerie, sleepwear and swimwear, fusing excelling quality in workmanship, unrivalled fit and the latest in fashionable design. ', '', '', 1),
(2, 'Beaujais', 1, 'beaujais', 'Beaujais', 'beaujais_lingerie_logo.png', NULL, 'beaujais_lingerie_logo.png', 'With over 18 years experience in the lingerie industry', 'In 2016 Triumph celebrates 130 years of creativity, innovation and dedication by continuing to set industry standards in its core competence of best fit, derived from a deep knowledge and understanding of the female body.\r\nTriumph today enjoys a presence in over 120 countries all across the world. For its brands Triumph and sloggi the company develops, produces and sells underwear, lingerie, sleepwear and swimwear, fusing excelling quality in workmanship, unrivalled fit and the latest in fashionable design.', '', '', 1),
(3, 'Recco', 1, 'recco', 'Recco', 'brand_2_.gif', NULL, 'brand_2_.gif', 'Brand that blasts that impression to smithereens', 'Their lingerie is made by companies who care about people and the environment, mixing eco-style with socially conscious production.\r\nPrinciples such as fair trade, organic growing, caring for the environment and workers are at the heart of Saumarez. They take great care ensuring their products and packaging are beautiful and of the highest ethical standards.', '', '', 1),
(4, 'Naf Naf', 1, 'naf-naf', 'Naf Naf', 'brand.gif', NULL, 'brand.gif', 'The company was founded by Behal who comes from experience in manufacturing, export, retailing and marketing of lingerie products. ', 'The company was founded by Behal who comes from experience in manufacturing, export, retailing and marketing of lingerie products. \r\n A catalog size of over 900 products (more than the top 10 lingerie brands in India combined) and product ranges across category verticals, including bras, briefs, nightwear, swimwear, shapers and accessories has meant that the brand is a breath of fresh air for young women (and men) online. \r\nPrettySecrets aims to be the largest lingerie brand in India. Importantly, the company views itself as a brand company -- not an ecommerce one.', '', '', 1),
(5, 'Calvin Klein', 1, 'calvin-klein', 'Calvin Klein', 'cku-logo.png', NULL, NULL, 'The company was founded in 1968 by Barry Schwartz and designer Calvin Klein.\r\nSince its inception, Calvin Klein Underwear for men and women has led the market by offering consumers cutting-edge design, innovative fabrics, and exceptional fit and quality.', 'The company was founded in 1968 by Barry Schwartz and designer Calvin Klein.\r\nSince its inception, Calvin Klein Underwear for men and women has led the market by offering consumers cutting-edge design, innovative fabrics, and exceptional fit and quality. \r\n\r\nKnown for its iconic advertising campaigns featuring top models, celebrities, and newly discovered talent, Calvin Klein Underwear continues to evolve its reputation as the brand of choice for consumers who want sexy, fashionable, and comfortable ', '', '', 1),
(6, 'Vixen', 1, 'vixen', 'Vixen', 'e7dd4f1e985260dec02a5f6f897db2b8.jpg', NULL, 'e7dd4f1e985260dec02a5f6f897db2b8.jpg', 'Known for its iconic advertising campaigns featuring top models, celebrities, and newly discovered talent, Calvin Klein Underwear continues to evolve its reputation as the brand of choice for consumers who want sexy, fashionable, and comfortable ', 'The company was founded in 1968 by Barry Schwartz and designer Calvin Klein.\r\nSince its inception, Calvin Klein Underwear for men and women has led the market by offering consumers cutting-edge design, innovative fabrics, and exceptional fit and quality. \r\n\r\nKnown for its iconic advertising campaigns featuring top models, celebrities, and newly discovered talent, Calvin Klein Underwear continues to evolve its reputation as the brand of choice for consumers who want sexy, fashionable, and comfortable ', '', '', 1);
